std::string get_area_data2(std::string area_name, int &x, int &y) {

    std::transform(area_name.begin(), area_name.end(),area_name.begin(), ::toupper);

    if (x<0 || y<0) {
        extra_octants=0;
        extra_octants_belong_to_string_pointer=NULL;
        extra_octants_belong_to_string_pointer_x=0;
    }
    latitude_longditude="";
//    printf("Area name=%s\n",area_name.c_str());
    if (area_name == "BRUSSEL") return get_octant_BRUSSEL(x,y);
    else if (area_name == "LA") return get_octant_LA(x,y);
    else if (area_name == "ENSCHEDE") return get_octant_ENSCHEDE(x,y);
    else if (area_name == "NEWYORK") return get_octant_NEWYORK(x,y);
    else if (area_name == "MODELS") return get_Model(x,y);
    else if (area_name == "MIAMI") return get_octant_MIAMI(x,y);
    else if (area_name == "DENHAAG") return get_octant_DENHAAG(x,y);
    else if (area_name == "CANVAS") return get_Canvas(x,y);
    else if (area_name == "SCHWEIZ") return get_octant_SCHWEIZ(x,y);
    else if (area_name == "AMSTERDAM") return get_octant_AMSTERDAM(x,y);
    else if (area_name == "RIO") return get_octant_RIO(x,y);
    else if (area_name == "UTRECHT") return get_octant_UTRECHT(x,y);
    else if (area_name == "AZORES") return get_octant_AZORES(x,y);

    return "Error not in get_area_data2()";
}

std::string get_area_data(std::string area_name, int &x, int &y) {
    bool check=false;
    if (!(x<0 || y<0)) {
        check=true;
    }
    if (x==-99999) {
        std::string model_file=std::string()+MODELS+"/"+area_name+".nbt";
        if (FileExists(model_file.c_str())) return model_file;
        else {
            printf("Model file %s not found.\n",model_file.c_str());
            return "";
        }
    }

    std::string ret=get_area_data2(area_name, x, y);
    if (extra_octants>0 && x==extra_octants_belong_to_string_pointer_x) {
        on_hold=true;
        return ret;
    }
    if (!burn && check && extra_octants>0 && !(ret=="") && extra_octants_belong_to_string_pointer!=NULL && !on_hold) {
        bool first=true;
        to_load_extra.clear();
        for (int p=0; p<extra_octants; p++) {
            std::string to_test=extra_octants_belong_to_string_pointer[p];
            char octant[100];
            int xx,yy;
            int num=sscanf(to_test.c_str(),"%100[^ ] X=%d Y=%d", octant, &xx, &yy);
            if (xx==x && yy==y) {
                bool skip=false;
                for (auto u : to_load_extra) {
                    if (u.x==xx && u.y==yy) skip=true;
                }
                if (!skip) {
//                    if (first) printf("EXTRA FOUND FOR: X=%d,Y=%d %s\n",xx,yy,octant);
//                    std::string extra=get_area_data2(area_name, extra_octants_belong_to_string_pointer_x, p);
//                    printf("EXTRA: X=%d,Y=%d %s\n",extra_octants_belong_to_string_pointer_x, p, extra.c_str());
                    if (get_area_data2(area_name, extra_octants_belong_to_string_pointer_x, p)!="") {
                        to_load_extra.push_back(glm::vec2(extra_octants_belong_to_string_pointer_x, p));
                        load_extra=true;
                    }
                    first=false;
                }
            }
        }
//        to_load_extra.push_back(glm::vec2(x,y)); //reset cur_x, cur_y (then get already loaded msg after loading extra's...)
    }
    on_hold=true;
    return ret;
}

std::string get_Canvas(int &x, int &y) {
    static int first_do=1;
    if (x<0 || y<0) {
        x=BITMAPSX;y=BITMAPSY;
        return "";
    }
    if (x>=BITMAPSX || y>=BITMAPSY) printf("Out of bound: %s X=%d Y=%d\n",area.c_str(),x,y);
    char naam[2000];
    sprintf(naam,"%s/canvas.nbt",MODELS);
    return_root = std::string()+naam;
    return return_root;
}

