std::string get_Model(int &x, int &y) {
    int ret;
    static bool first_do=true;
    static int line_count=0;
    char model_name[2000];
    char model_list[2000];

    if (obj_filename!="") {
        strcpy(MODELS,"../schematic");
        sprintf(model_list,"%s/list.txt",MODELS);
        if (x>=0) line_count=x;
        ret=select_from_list2(model_name,model_list,line_count);

        if (x<0 || y<0) {
            x=ret;y=1;
            return "";
        }
        if (line_count++>ret) line_count=0;
        if (ret==0) {
            printf("%s EMPTY?\n",model_list);
            return "";
        } else {
            obj_filename=model_name;
            first_do=false;
            return model_name;
        }

        if (x<0 || y<0) {
            x=1;y=1;
            return "";
        } else if (FileExists(obj_filename.c_str()) ) {
            sprintf(model_name,"%s",obj_filename.c_str());
            while (replace_str(model_name,"\\","/"));
            printf("Object filename=%s\n",model_name);
            return model_name;
        } else {
            sprintf(model_name,"%s/%s",MODELS,obj_filename.c_str());
            while (replace_str(model_name,"\\","/"));
            if (FileExists(model_name)) {
                printf("Object filename=%s\n",model_name);
                return model_name;
            } else {
                printf("%s doesn't exist?\n",model_name);
                return "";
            }
        }
    }

    sprintf(model_list,"%s/list.txt",MODELS);
    if (x>=0) line_count=x;
    ret=select_from_list2(model_name,model_list,line_count);
    while (replace_str(model_name,"\\","/"));

    if (x<0 || y<0) {
        x=ret;y=1;
        return "";
    }
    if (line_count++>ret) line_count=0;
    if (ret==0) {
        printf("%s EMPTY?\n",model_list);
        return "";
    } else {
        return model_name;
    }
}



